import React from 'react'
import Todo from './Todo'

export default function TodoList({ todos, toggleTodo, deleteTodo }) {
  return (
		todos.map(todo => {
		return	<Todo key={todo.id} toggleTodo={toggleTodo} deleteTodo={deleteTodo} todo={todo} />
		})
  )
}
